import React, { useState, useEffect } from 'react';
import axios from 'axios';

import {
  Card,
  CardBody,
  Image,
  Button,
  Label,
  Input,
} from '@windmill/react-ui';
import { config } from '../Constants';


const ProfilePage = () => {

    const token = localStorage.getItem('accessToken')
    const [customer, setCustomer] = useState(null);
    const apiBaseUrl = config.url.API_BASE_URL;
    const options = {
        headers: {
            Authorization: `Bearer ${token}`,
        },
    };




    useEffect(() => {
        const fetchUser = async () => {
            try {

                const response = await axios.get(`${apiBaseUrl}/api/customers/logged-user`, options);
                setCustomer(response.data);
                console.log(customer)
            } catch (error) {
                console.error('Error fetching customer:', error);
            }
        };

        fetchUser();
    }, [token, apiBaseUrl]);



  return (
    <div className="flex  justify-center min-h-screen bg-gray-100">
      <Card className="w-full max-w-sm mx-auto">
       
        <CardBody>
          <h2 className="text-xl font-semibold text-center">John Doe</h2>
          <p className="text-center text-gray-600">Software Engineer</p>
          <div className="mt-4">
            <Label>
              <span>Email</span>
              <Input className="mt-1" placeholder={customer.email} disabled />
            </Label>
          </div>
          <div className="mt-4">
            <Label>  
              <span>Phone</span>
              <Input className="mt-1" placeholder="(123) 456-7890" disabled />
            </Label>
          </div>
          <div className="mt-4">
            <Button className="w-full" layout="outline">
              Edit Profile
            </Button>
          </div>
        </CardBody>
      </Card>
    </div>
  );
};

export default ProfilePage;
